import React from 'react';
import axios from 'axios';


export default class App extends React.Component {

    render() {
        axios.get('http://localhost:8080/device_summary', {
                    headers: {
                        'Access-Control-Allow-Origin': '*',
                    }
                }

            )
            .then(res => {
                console.log(res.data);
            })
            .catch(error => {
                console.log(error);
            })
        return ("he");
    }
}
